import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Form from "react-bootstrap/Form";
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import ToggleDarkMode from "./ToggleDarkMode";
import DropdownButton from "./DropDownButton";

function NavScrollExample() {
    return (
        <Navbar expand="lg" className="bg-body-tertiary">
            <Container fluid>
                <Navbar.Brand href="#">
                    <strong style={{ fontSize:'30px', color: 'orange' }}>GIS</strong>
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="navbarScroll" />
                <Navbar.Collapse id="navbarScroll">
                    <Nav
                        className="me-auto my-2 my-lg-0"
                        style={{ maxHeight: '100px' }}
                        navbarScroll
                    >
                        <center></center>
                        <Nav.Link href="#action1">Home</Nav.Link>
                        <NavDropdown title="File" id="navbarScrollingDropdown">
                            <NavDropdown.Item href="#action3">Upload</NavDropdown.Item>
                            <NavDropdown.Item href="#action4">
                                Download
                            </NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item href="#action5">
                                View
                            </NavDropdown.Item>
                        </NavDropdown>
                    </Nav>
                    <Form className="d-flex">
                        <DropdownButton/>
                    </Form>
                    <Form className="d-flex" style={{ border: '10px solid transparent' }}>
                        <ToggleDarkMode/>
                    </Form>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}
export default NavScrollExample;
